  return (
    <div className="m-4">
      {/* {face?  */}
      <ReactCardFlip>
        <img alt={value} src={image}/>
        <img className='h-80' alt="card-back" src="blue-card-back.png"/>

      </ReactCardFlip>
    </div>

  )
}
